import { Component } from '@angular/core';

@Component({
  selector: 'app-img',
  templateUrl: './img.component.html',
  styleUrls: ['./img.component.css']
})
export class ImgComponent {
  itsBig:boolean=false;
  makeBig(){
    this.itsBig=true;
  }
}
